import React, { Component } from 'react';

class CurrencyDropdown extends Component {
  render() {
    const { initials: { code } } = this.props;
    return (
      <div>
        <input type='select' data-testid="currency-input" name="teste" value="testes">
          <option data-testid={ code }>{code}</option>
        </input>
      </div>
    );
  }
}

export default CurrencyDropdown;
